import React from 'react';

const IntroPage = React.lazy(() => import('../components/pages/IntroPage'))

const routes = [
    {
        path: '/',
        component: IntroPage,
        exact: true,
        authRequired: false,
        layouts: [],
    }
];


export default routes;
